 private static int getmask(int cols) {
  return (int)(4294967040l >>> (8-cols))&0xffff;
 }

 private static byte[] readboard(byte[] board, BufferedReader in, int mask) throws IOException {
  for (int i = 0; i < board.length; i++)
  {
   int v = 0;
   for (char c = (char) in.read(); c=='.' || c =='#'; c = (char) in.read(),v <<=1)
   {
    v |=  (c == '.')?0:1;
   }
   v >>=1;
   board[i] =  (byte) (v|mask);
  }
  return board;
 }

